    {
        key: 'GOOGLE_ANALITICS',
        icon: <GoogleOutlined />,
        label: 'Google analitics'
    },
    {
        key: 'GOOGLE_ADS',
        icon: <GoogleSquareFilled />,
        label: 'Google ads'
    },
];
